import React, { Component } from 'react';

import Tables from '../components/Tables';

var $  = require( 'jquery' );

class HomeOne extends Component {
  constructor(props) {
    super(props);
    this.state = {
        condition: false,
    };

    this.toggleMenu = this.toggleMenu.bind(this);
    this.toggleMenu2 = this.toggleMenu2.bind(this);

}

toggleMenu() {
    this.setState({condition: true})
}
toggleMenu2() {
    this.setState({condition: false})
}


  componentDidMount(){
    $(function(){
      $('.tableToggle').click(function(){
        $('.table .Header').toggleClass('hide');
        $('.rowData').toggleClass('rowDataCard').toggleClass('col-lg-3');
        $('.table').toggleClass('rowDataCardTable');
      });
    });
}
render() {
    return (
        <div className="wrapper">
            <div className="table-responsive"> 
                <button className="tableToggleBtn" onMouseEnter={ this.toggleMenu }>Toggle</button>
                <div className= { this.state.condition ? "card" : "card tableToggleWrap" } onMouseLeave={ this.toggleMenu2 }>
                <div class="card-body">
                  <p  className="btn btn-primary tableToggle">Card</p>
                </div>
                </div>
              <Tables/>
            </div>
        </div>);
}
}

export default HomeOne;
